import './App.css';

function test() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function App()
{
    return
    ( 
      <div className="App"><h1>Test Function</h1></div>
    );
}
export default test;
